-- ----------------------------
-- Procedure structure for ACCT_CUM_VAL
-- ----------------------------
DROP PROCEDURE IF EXISTS `ACCT_CUM_VAL`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ACCT_CUM_VAL`( IN  `pVRDT` DATE, IN  `pCTRLCODE` VARCHAR( 4 ) CHARSET utf8, IN  `pSUBCODE` VARCHAR( 4 ) CHARSET utf8, IN  `pOFFCODE` VARCHAR( 4 ) CHARSET utf8, OUT `pBAL_AMT` FLOAT( 10, 2 ) )
BEGIN
        DECLARE vmnyr Date;
        DECLARE CONTINUE HANDLER FOR NOT FOUND SET pBAL_AMT = 0;
        set pBAL_AMT = 0;
        SELECT MAX(mnyr) INTO vmnyr FROM acct_monthly_acc_bal WHERE mnyr < pVRDT AND mnyr > '30-OCT-03'  AND ctrlcode = pctrlcode AND subcode = pSUBCODE AND office_code = pOFFCODE;

        IF (MONTH(vmnyr) = '12' and pCTRLCODE  > '5') 
            Then set pBAL_AMT = 0;
        ELSE 
            SELECT IFNULL(cum_bal,0) INTO pBAL_AMT FROM acct_monthly_acc_bal WHERE mnyr = vmnyr  AND ctrlcode = pctrlcode AND subcode = pSUBCODE AND office_code = pOFFCODE;
        END IF;
    END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for ADD_INTO_MONTHLY_ACC_BAL
-- ----------------------------
DROP PROCEDURE IF EXISTS `ADD_INTO_MONTHLY_ACC_BAL`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ADD_INTO_MONTHLY_ACC_BAL`( IN `pVRNO` VARCHAR( 255 ) , IN `pDATE` DATE, IN `pCTRLCODE` VARCHAR( 4 ) , IN `pSUBCODE` VARCHAR( 4 ) , IN `pOFFICECODE` VARCHAR( 4 ) , IN `pTRTYPE` VARCHAR( 1 ) , IN `pAMT` FLOAT , IN `pBAL_AMT` FLOAT)
BEGIN
        DECLARE vDrAmt FLOAT(15,2);
        DECLARE vCrAmt FLOAT(15,2);
        DECLARE vBalAmt FLOAT(15,2);

                IF pTRTYPE = 'D' Then
            SET vDrAmt  = IFNULL(pAMT,0);
            SET vBalAmt = IFNULL(pAMT,0);
        ELSEIF pTRTYPE = 'C' Then
            SET vCrAmt  = IFNULL(pAMT,0);
            SET vBalAmt = -IFNULL(pAMT,0);
        END IF;

            VALUES (DATE_FORMAT(pDate,'%y-%m-01'), pCtrlcode, pSubcode, pOfficecode, IFNULL(vDrAmt,0), IFNULL(vCrAmt,0), IFNULL(pbal_amt,0) + IFNULL(vbalamt,0))

            ON DUPLICATE KEY UPDATE 
							balance_dr = IFNULL(VALUES(balance_dr), 0) + IFNULL(vDrAmt,0), balance_cr = IFNULL(VALUES(balance_cr), 0) + IFNULL(vCrAmt,0), cum_bal = IFNULL(VALUES(cum_bal), 0) + IFNULL(vBalAmt,0);

                IF pCtrlcode < '5' THEN
            UPDATE acct_monthly_acc_bal SET cum_bal = IFNULL(cum_bal, 0) + IFNULL(vBalAmt,0)
                WHERE mnyr > DATE_FORMAT(pDate,'%y-%m-01') AND ctrlcode = pCtrlcode AND subcode = pSubcode AND office_code = pOfficecode;
				ELSE
            UPDATE acct_monthly_acc_bal SET cum_bal = IFNULL(cum_bal, 0) + IFNULL(vBalAmt,0)
                WHERE mnyr > DATE_FORMAT(pDate,'%y-%m-01') AND mnyr <= Add_months(DATE_FORMAT(pDate,'%y-%m-01'),12) AND ctrlcode = pCtrlcode AND subcode = pSubcode AND office_code = pOfficecode;
        END IF;
    END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for DELETE_FROM_MONTHLY_ACC_BAL
-- ----------------------------
DROP PROCEDURE IF EXISTS `DELETE_FROM_MONTHLY_ACC_BAL`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `DELETE_FROM_MONTHLY_ACC_BAL`( IN `pVRNO` VARCHAR( 255 ) , IN `pDATE` DATE, IN `pCTRLCODE` VARCHAR( 4 ) , IN `pSUBCODE` VARCHAR( 4 ) , IN `pOFFICECODE` VARCHAR( 4 ) , IN `pTRTYPE` VARCHAR( 1 ) , IN `pAMT` FLOAT)
BEGIN
        DECLARE vDrAmt FLOAT(15,2);
        DECLARE vCrAmt FLOAT(15,2);
        DECLARE vBalAmt FLOAT(15,2);

                IF pTRTYPE = 'D' Then
            SET vDrAmt  = IFNULL(pAMT,0);
            SET vBalAmt = IFNULL(pAMT,0);
        ELSEIF pTRTYPE = 'C' Then
            SET vCrAmt  = IFNULL(pAMT,0);
            SET vBalAmt = -IFNULL(pAMT,0);
        END IF;

        UPDATE  acct_monthly_acc_bal set balance_dr = IFNULL(VALUES(balance_dr), 0) - IFNULL(vDrAmt,0), balance_cr = IFNULL(VALUES(balance_cr), 0) - IFNULL(vCrAmt,0), cum_bal = IFNULL(VALUES(cum_bal), 0) - IFNULL(vBalAmt,0) WHERE
         mnyr = DATE_FORMAT(pDate,'%y-%m-01') AND
         ctrlcode = pCtrlcode AND
         subcode = pSubcode AND
         office_code = pOfficecode;

                IF pCtrlcode < '5' THEN
            UPDATE acct_monthly_acc_bal SET cum_bal = IFNULL(cum_bal, 0) - IFNULL(vBalAmt,0)
                WHERE mnyr > DATE_FORMAT(pDate,'%y-%m-01') AND ctrlcode = pCtrlcode AND subcode = pSubcode AND office_code = pOfficecode;
				ELSE
            UPDATE acct_monthly_acc_bal SET cum_bal = IFNULL(cum_bal, 0) - IFNULL(vBalAmt,0)
                WHERE mnyr > DATE_FORMAT(pDate,'%y-%m-01') AND mnyr <= Add_months(DATE_FORMAT(pDate,'%y-%m-01'),12) AND ctrlcode = pCtrlcode AND subcode = pSubcode AND office_code = pOfficecode;
        END IF;
    END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for ACCT_OPENING_BAL_TEST
-- ----------------------------
DROP FUNCTION IF EXISTS `ACCT_OPENING_BAL_TEST`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `ACCT_OPENING_BAL_TEST`(P_CTRLCODE varchar(4),P_SUBCODE varchar(4),P_OFFICE_CODE varchar(4),P_DATE DATE) RETURNS float
    DETERMINISTIC
BEGIN
    DECLARE V_OPENING_BAL  FLOAT(10,2);
		DECLARE V_TOTAL_AMT  FLOAT(10,2);
		DECLARE V_MAX_MNYR  DATE;
		DECLARE V_ACCTYPE VARCHAR(1);

		        
        SELECT DISTINCT ACCTYPE INTO V_ACCTYPE FROM ACCT_HEAD WHERE CTRLCODE = P_CTRLCODE AND SUBCODE =  P_SUBCODE;
        
		                        
		IF (V_ACCTYPE =  'E' OR V_ACCTYPE =  'I' AND MONTH(DATE_SUB(P_DATE, INTERVAL 1 MONTH)) = '12') 
            THEN SET V_OPENING_BAL = 0;
		ELSEIF (V_ACCTYPE = 'E' OR V_ACCTYPE =  'I' AND MONTH(DATE_SUB(P_DATE, INTERVAL 1 MONTH)) != '12') 

            THEN
                SELECT IFNULL(MAX(MNYR), P_DATE - 1) INTO V_MAX_MNYR FROM ACCT_MONTHLY_ACC_BAL
                WHERE MNYR < DATE_FORMAT( P_DATE,  '%Y-%m-01' )
                AND MNYR > '2017-10-03'
                AND CTRLCODE = P_CTRLCODE
                AND SUBCODE = P_SUBCODE
                AND OFFICE_CODE = P_OFFICE_CODE
                AND YEAR(MNYR) = YEAR(P_DATE);
        ELSE
            SELECT IFNULL(MAX(MNYR), P_DATE - 1)
            INTO V_MAX_MNYR
            FROM ACCT_MONTHLY_ACC_BAL
            WHERE MNYR < DATE_FORMAT( P_DATE,  '%Y-%m-01' )
            AND MNYR > '2017-10-03'
            AND CTRLCODE = P_CTRLCODE
            AND SUBCODE = P_SUBCODE
            AND OFFICE_CODE = P_OFFICE_CODE;
		END IF;
        
                
		SELECT IFNULL(SUM(IFNULL(M.CUM_BAL,0)),0) INTO V_OPENING_BAL FROM ACCT_MONTHLY_ACC_BAL M WHERE M.MNYR = V_MAX_MNYR AND M.CTRLCODE = P_CTRLCODE AND M.SUBCODE = P_SUBCODE AND M.OFFICE_CODE = P_OFFICE_CODE;

		SET V_MAX_MNYR = DATE_SUB(P_DATE,INTERVAL 1 MONTH);
        
                
        SELECT IFNULL(SUM(TOT_AMT),0) INTO V_TOTAL_AMT FROM ACCT_CQ_VOUCHER WHERE VRDT > V_MAX_MNYR AND VRDT < P_DATE AND  ACC_HEAD_CTRLCODE = P_CTRLCODE AND ACC_HEAD_SUBCODE = P_SUBCODE AND OFFICE_CODE = P_OFFICE_CODE;
        
        SET V_OPENING_BAL =  V_OPENING_BAL - V_TOTAL_AMT;
        
                
        SELECT IFNULL(SUM(IF(TRTYPE = 'D',AMT,-AMT)),0) INTO V_TOTAL_AMT FROM ACCT_CQCHILD WHERE VRDT > V_MAX_MNYR AND VRDT < P_DATE AND ACC_HEAD_CTRLCODE = P_CTRLCODE AND ACC_HEAD_SUBCODE = P_SUBCODE AND OFFICE_CODE = P_OFFICE_CODE;

        SET V_OPENING_BAL =  V_OPENING_BAL + V_TOTAL_AMT;
        
                
        SELECT IFNULL(SUM(TOT_AMT),0) INTO V_TOTAL_AMT FROM ACCT_MR WHERE MRDT > V_MAX_MNYR AND MRDT < P_DATE AND ACC_HEAD_CTRLCODE = P_CTRLCODE AND ACC_HEAD_SUBCODE = P_SUBCODE AND OFFICE_CODE = P_OFFICE_CODE;

        SET V_OPENING_BAL =  V_OPENING_BAL + V_TOTAL_AMT;

                
        SELECT IFNULL(SUM(IF(TRTYPE = 'D',AMOUNT,-AMOUNT)),0) INTO V_TOTAL_AMT FROM ACCT_MRCHILD WHERE MRDT > V_MAX_MNYR AND MRDT < P_DATE AND ACC_HEAD_CTRLCODE = P_CTRLCODE AND ACC_HEAD_SUBCODE = P_SUBCODE AND OFFICE_CODE = P_OFFICE_CODE;

        SET V_OPENING_BAL =  V_OPENING_BAL + V_TOTAL_AMT;
        
                
        SELECT IFNULL(SUM(IF(TRTYPE = 'D',AMT,-AMT)),0) INTO V_TOTAL_AMT FROM ACCT_JVCHILD WHERE VRDT > V_MAX_MNYR AND VRDT < P_DATE AND ACC_HEAD_CTRLCODE = P_CTRLCODE AND ACC_HEAD_SUBCODE = P_SUBCODE AND OFFICE_CODE = P_OFFICE_CODE;

        SET V_OPENING_BAL = V_OPENING_BAL + V_TOTAL_AMT;

 RETURN (V_OPENING_BAL);
END
;;
DELIMITER ;
